// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

interface IFactory {
    function getExchange(address _tokenAddress) external returns (address);
}

interface IExchange {
    function ethToTokenTransfer(
        uint256 _minToken,
        address _recipient
    ) external payable;
}

contract Exchange is ERC20 {
    address public tokenAddress;
    address public factoryAddress;

    constructor(address _token) ERC20("Zuniswap-v1", "ZUNI-V1") {
        require(_token != address(0), "Token address is invalid");

        tokenAddress = _token;
        factoryAddress = msg.sender;
    }

    function addLiquidity(
        uint256 _tokenAmount
    ) public payable returns (uint256) {
        if (getReserve() == 0) {
            IERC20 token = IERC20(tokenAddress);
            token.transferFrom(msg.sender, address(this), _tokenAmount);

            uint256 liquidity = getETHReserve();
            _mint(msg.sender, liquidity);
            return liquidity;
        } else {
            uint256 ethReserve = address(this).balance - msg.value;
            uint256 tokenReserve = getReserve();

            uint256 tokenAmount = (msg.value) * (tokenReserve / ethReserve);

            require(_tokenAmount >= tokenAmount, "insufficient token amount");

            IERC20 token = IERC20(tokenAddress);
            token.transferFrom(msg.sender, address(this), tokenAmount);

            uint256 liquidity = totalSupply() * (msg.value / ethReserve);
            _mint(msg.sender, liquidity);
            return liquidity;
        }
    }

    function removeLiquidity(
        uint256 _amount
    ) public returns (uint256, uint256) {
        require(_amount > 0, "invalid amount");

        uint256 ethAmount = address(this).balance * (_amount / totalSupply());
        uint256 tokenAmount = getReserve() * (_amount / totalSupply());

        _burn(msg.sender, _amount);
        payable(msg.sender).transfer(ethAmount);
        IERC20(tokenAddress).transfer(msg.sender, tokenAmount);

        return (ethAmount, tokenAmount);
    }

    function getReserve() public view returns (uint256) {
        return IERC20(tokenAddress).balanceOf(address(this));
    }

    function getETHReserve() public view returns (uint256) {
        return address(this).balance;
    }

    function getPrice(
        uint256 inputReserve,
        uint256 outputReserve
    ) public pure returns (uint256) {
        require(inputReserve > 0 && outputReserve > 0, "invalid reserve");

        return (inputReserve * 1000) / outputReserve;
    }

    function getAmount(
        uint256 inputAmount,
        uint256 inputReserve,
        uint256 outputReserve
    ) private pure returns (uint256) {
        require(inputReserve > 0 && outputReserve > 0, "invalid reserve");

        uint256 inputAmountWithFee = inputAmount * 99;
        uint256 numerator = inputAmountWithFee * outputReserve;
        uint256 denominator = (inputReserve * 100) + inputAmountWithFee;

        return numerator / denominator;
    }

    function getTokenAmount(uint256 _ethSold) public view returns (uint256) {
        require(_ethSold > 0, "eth is too small");
        uint256 tokenReserve = getReserve();
        uint256 ethReserve = getETHReserve();

        return getAmount(_ethSold, ethReserve, tokenReserve);
    }

    function getETHAmount(uint256 _tokenSold) public view returns (uint256) {
        require(_tokenSold > 0, "token is too small");
        uint256 tokenReserve = getReserve();
        uint256 ethReserve = getETHReserve();

        return getAmount(_tokenSold, tokenReserve, ethReserve);
    }

    function ethToToken(uint256 _minTokens, address _recipient) private {
        uint256 tokenReserve = getReserve();
        uint256 ethReserve = getETHReserve();

        uint256 tokenBought = getAmount(
            msg.value,
            ethReserve - msg.value, // substract msg.value because the exchange address already receive msg.value ether. Therefore, to calculate initial supply of ether we need to substract with amount of ether sent first.
            tokenReserve
        );

        require(tokenBought >= _minTokens, "insufficient output amount");

        IERC20(tokenAddress).transfer(_recipient, tokenBought);
    }

    function ethToTokenSwap(uint256 _minToken) public payable {
        ethToToken(_minToken, msg.sender);
    }

    function ethToTokenTransfer(
        uint256 _minTokens,
        address _recipient
    ) public payable {
        ethToToken(_minTokens, _recipient);
    }

    function tokenToETHSwap(
        uint256 _tokenSold,
        uint256 _minETH
    ) public payable {
        uint256 tokenReserve = getReserve();
        uint256 ethReserve = getETHReserve();

        uint256 ethBought = getAmount(_tokenSold, tokenReserve, ethReserve);

        require(ethBought >= _minETH, "insufficient output amount");

        IERC20(tokenAddress).transferFrom(
            msg.sender,
            address(this),
            _tokenSold
        );
        payable(msg.sender).transfer(ethBought);
    }

    function tokenToTokenSwap(
        uint256 _tokenSold,
        uint256 _minTokenBought,
        address _tokenAddress
    ) public {
        address exchangeAddress = IFactory(factoryAddress).getExchange(
            _tokenAddress
        );

        require(
            exchangeAddress != address(this) && exchangeAddress != address(0),
            "invalid exchange address"
        );

        uint256 tokenReserve = getReserve();
        uint256 ethReserve = getETHReserve();

        uint256 ethBought = getAmount(_tokenSold, tokenReserve, ethReserve);

        IERC20(tokenAddress).transferFrom(
            msg.sender,
            address(this),
            _tokenSold
        );

        IExchange(exchangeAddress).ethToTokenTransfer{value: ethBought}(
            _minTokenBought,
            msg.sender
        );
    }
}

contracts/Factory.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;
import "./Exchange.sol";

contract Factory {
    mapping(address => address) public tokenToExchange;

    function createExchange(address _tokenAddress) public returns (address) {
        require(_tokenAddress != address(0), "invalid token address");

        require(
            tokenToExchange[_tokenAddress] == address(0),
            "exchange already exist"
        );

        Exchange exchange = new Exchange(_tokenAddress);
        tokenToExchange[_tokenAddress] = address(exchange);

        return address(exchange);
    }

    function getExchange(address _tokenAddress) public view returns (address) {
        return tokenToExchange[_tokenAddress];
    }
}

